import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import "./App.css";
import Home from "./Home";
import Navbar from "./Navbar";
import Registration from "./Registration";
import Login from "./Login";
import Configuration from "./Configuration"; 

function App() {
  const [user, setUser] = useState(null);

  return (
    <div className="App">
      <Router>
        <Navbar user={user} setUser={setUser} /> {/* Pass user information to Navbar */}
        <Routes>
          <Route path="/" element={<Navigate to="/home" />} />
          <Route exact path="/" render={() => <Navigate to="/home" />} />
          <Route path="/home" element={<Home user={user} />} /> {/* Pass user information to Home */}
          <Route path="/login" element={<Login setUser={setUser} />} /> {/* Pass setUser function to Login */}
          <Route path="/configuration" element={<Configuration />} />
          <Route path="/registration" element={<Registration />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
